import React from "react";
import "../styles/LandingPage.css";

function LandingPage() {
    return (
        <div className="landing-page-container">
            {/* Navbar */}
            <nav className="landing-navbar">
                <div className="landing-navbar-logo">
                    <img src="/images/logo3.jpg" alt="Logo" />
                </div>
                <div className="landing-navbar-links">
                    <a href="#services">Services</a>
                    <a href="#about">About Us</a>
                    <a href="#contact">Contact</a>
                </div>
                <div className="landing-navbar-auth">
                    <a href="/login">Login</a>
                    <a href="/register" className="btn-landing-primary">Sign Up</a>
                </div>
            </nav>

            {/* Hero Section */}
            <section className="landing-hero">
                <div className="landing-hero-content">
                    <h1>!Snow Removal Services!</h1>
                    <button className="btn-landing-primary">Learn More</button>
                </div>
            </section>
        </div>
    );
}

export default LandingPage;
